import {Grid, IconButton, Link,Paper, List, ListItem, ListItemIcon ,ListItemText} from "@material-ui/core";
import HomeIcon from '@material-ui/icons/Home';
import InfoIcon from '@material-ui/icons/Info';
import ContactMailIcon from '@material-ui/icons/ContactMail';
import {makeStyles} from '@material-ui/core/styles';
export default function Footer(){
    return(
        <div className="classes.root" style={{backgroundColor:"Navy"}}>
            <Grid container item justify="center" alignItems="center">
                <List>
                    <ListItem>
                        <Link href='/'>
                            <IconButton><HomeIcon/>Home</IconButton>
                        </Link>
                    </ListItem>
                    <ListItem>
                        <Link href='/'>
                            <IconButton><InfoIcon/>About</IconButton>
                        </Link>
                    </ListItem>
                    <ListItem>
                        <Link href='/'>
                            <IconButton><ContactMailIcon/>Contact</IconButton>
                        </Link>
                    </ListItem>
                </List>
            </Grid>
        </div>
    );
}
